public class TestA\n{\n     public bool B { get; set; }\n     public bool C { get; set; }\n}\n\nclass Program\n{\n    static void Main()\n    {\n        var dslParser = new DslParser<TestA>();\n        var expr = dslParser.Parse("B == true && C == false");\n\n        // Compiling the expression tree to a delegate.\n        Func<TestA, bool> compiledExpr = expr.Compile();\n\n        // Example usage of compiled expression\n        TestA testObject = new TestA { B = true, C = false };\n        Console.WriteLine(compiledExpr(testObject));  // Output should be True\n    }\n}